const s=["scene","staff","type"];export function match(e,f){for(let t in e)if(t==="skin"){let i=new Set;for(let l of f.staff)if(l!=="F")for(let o of f.skin[l])i.add(o);let r=Array.from(i);if(!n(e.skin,r))return console.log("skin not match"),!1}else if(t==="platform"){if(e.platform.indexOf(f.platform)===-1)return console.log("platform not match"),!1}else if(s.indexOf(t)!==-1){if(!n(e[t],f[t]))return console.log("insert not match"),!1}else if(t==="titlestr"){if(f.title.indexOf(e[t])!==-1)return!0}else if(t==="tagstr"){for(let i of f.tags)if(i.indexOf(e[t])!==-1)return!0}else if(t==="typestr"){for(let i of f.items)for(let r of i.item)if(r[0].indexOf(e[t])!==-1)return!0}else continue;return!1}function n(e,f){return e.length+f.length!==Array.from(new Set([...e,...f])).length}
